# Data Loading
class DataLoader:
    @staticmethod
    def load_fpds_data(start_year: int = 2007) -> pd.DataFrame:
        """Load historical FPDS data from 2007 to present"""
        fpds_url = "https://api.example.com/fpds"
        params = {"start_year": start_year}
        response = requests.get(fpds_url, params=params)
        response.raise_for_status()
        return pd.DataFrame(response.json())

    @staticmethod
    def load_fabs_data() -> pd.DataFrame:
        """Load historical FABS submissions"""
        fabs_url = "https://api.example.com/fabs"
        response = requests.get(fabs_url)
        response.raise_for_status()
        return pd.DataFrame(response.json())

# System Administration
class SystemAdmin:
    @staticmethod
    def derive_funding_agency_codes(data: pd.DataFrame) -> Dict:
        """Derive funding agency codes from submission data"""
        return data['agency_code'].value_counts().to_dict()

    @staticmethod
    def process_deletions(cutoff_date: str) -> int:
        """Remove data older than cutoff date, return count of deleted items"""
        data = DataLoader.load_fpds_data()
        date_mask = pd.to_datetime(data['date']) < pd.to_datetime(cutoff_date)
        deleted_count = date_mask.sum()
        # In reality, we'd persist the filtered data
        return deleted_count

